 const ProductItem = ({image})=> {

        renderCard=()=>{
            return (
                <div className="card">
                    <img className="card-img-top" src={image} alt="img" />
                    <div className="card-body">
                        <p className="card-text">Lorem ipsum dolor sit amet consectetur, adipisicing elit. Totam animi debitis, error ipsam praesentium aliquid. Nesciunt blanditiis impedit facere, inventore voluptas amet vitae nobis exercitationem? Quibusdam quaerat explicabo modi fugiat.</p>
                    </div>
                </div>
            )
        }
        return(
            <div className="col">
                {renderCard}
            </div>
        )
    
 }

 export default ProductItem;
